import MovieForm from "../forms/movieForm.component";
import React, { Component } from "react";

//restrict access for users not logged in
class moviePage extends Component {
  render() {
    return (
      <>
        <h1> Movie Page </h1>
        <p>Create a movie</p>

        <MovieForm />
      </>
    );
  }
}

export default moviePage;
